import React from 'react';

const friends = [
  'Mikenzi',
  'Cash',
  'Steven',
  'Kimmy',
  'Doug'
];

const List = () => {
  // Render a list using the "friends" being passed in.
  return (
    <ul>
      {friends.map(item => (
        <li key={item.id}>{item.name}</li>
      ))}
    </ul>
  );
};

const Task = () => {
  return (
    <div>
      <List friends={friends} />
    </div>
  );
};

export default Task;
